description:
After receiving mysterious empty packages inside his apartment, a young computer-programmer begins a personal investigation into their origins.

Paranoid computer programmer Simon wakes up one morning to find a plain brown package in his apartment. He unwraps it, but there is nothing inside. Despite attempts to secure his apartment, the mysterious packages keep appearing. While security cameras watch his every move, Simon\'s hallucinations are pushing him to the boundaries of sanity...

